package com.Basics;

public class Swapping {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 20, b = 30;
		  
        System.out.println("Before Swap");
        System.out.println(a);
        System.out.println(b);
  
        int temp = a;
        a = b;
        b = temp;
  
        System.out.println("After swap");
        System.out.println(a);
        System.out.println(b);

	}

}
